import Header from "../../components/Header/Header";
import Footer from "../../components/Footer/Footer";

function ContactPage(props) {
  return (
    <>
      <Header
        text={props.text.header}
        languages={props.languages}
        curLang={props.currLang}
        setLanguage={props.setLanguage}
        links={props.links}
      ></Header>
      <section className="contact">
        <div className="contact__container _container">
            <div className="contact__wrapper">
                <div className="contact__left">
                    <div className="contact__left-item">
                        <span className="contact__left-text">{props.text.header.adress}</span>
                        <span className="_separator"></span>
                    </div>
                    <div className="contact__left-item">
                        <span className="contact__left-text">+38 (050) 390 15 95</span>
                        <span className="contact__left-text">contact@hlegals.net</span>
                        <span className="_separator"></span>
                    </div>
                    <div className="contact__left-item">
                        <span className="contact__left-text">Наша сторінка в фейсбуці</span>
                        <span className="_separator"></span>
                    </div>
                </div>
                <form action="" className="contact__right">

                </form>
            </div>
            <figure className="contact__map">
                <img src="./team/team1.png" alt="no-image" className="contact__image" />
            </figure>
        </div>
      </section>
      <Footer />
    </>
  );
}

export default ContactPage;
